import { useEffect, useState } from "react";

const Home = () => {
  const [blogs, setBlogs] = useState([]);

  useEffect(() => {
    const fetchBlogs = async () => {
      const response = await fetch("/");
      const json = response.json();

      if (response.ok) {
        setBlogs(json);
      }
    };

    fetchBlogs();
  }, []);

  return (
    <div className="pages">
      <div className="blogs">
        {blogs &&
          blogs.map((blog) => {
            <p>{blog.title}</p>;
          })}
      </div>
    </div>
  );
};

export default Home;
